I think the best way to do the pipes is to have a separate function for each number of pipes, like this:

```c
void pipes0(uint32_t *data, uint32_t *output) {
    // No pipes
    *output = *data;
}

void pipes1(uint32_t *data, uint32_t *output) {
    // One pipe
    *output = *data | (*data << 8);
}

void pipes2(uint32_t *data, uint32_t *output) {
    // Two pipes
    *output = *data | (*data << 8) | (*data << 16);
}

void pipes3(uint32_t *data, uint32_t *output) {
    // Three pipes
    *output = *data | (*data << 8) | (*data << 16) | (*data << 24);
}
```

Then you can have a function that takes the number of pipes as an argument and calls the appropriate function:

```c
void pipes(uint32_t *data, uint32_t *output, int num_pipes) {
    switch (num_pipes) {
        case 0:
            pipes0(data, output);
            break;
        case 1:
            pipes1(data, output);
            break;
        case 2:
            pipes2(data, output);
            break;
        case 3:
            pipes3(data, output);
            break;
        default:
            // Invalid number of pipes
            break;
    }
}
```

