To create a custom WordPress block with a heading, paragraph, and image, you can use the Block Editor (Gutenberg) and create a custom block using JavaScript. Here’s a step-by-step guide:

1. Set up your development environment:
   - Make sure you have Node.js and npm (Node Package Manager) installed on your machine.
   - Create a new WordPress plugin directory and navigate to it in your terminal.

2. Initialize a new block plugin:
   - Run the following command to initialize a new block plugin using the `@wordpress/create-block` package:
     ```
     npx @wordpress/create-block my-custom-block
     ```
   - Follow the prompts to set up your block plugin.

3. Customize the block:
   - Open the `src/index.js` file in your block plugin directory.
   - Update the block name, title, description, and other properties as needed.
   - In the `edit` function, you can define the block's appearance in the editor. Use the `RichText` component for the heading and paragraph, and the `MediaUpload` component for the image.
   - In the `save` function, you can define how the block will be rendered on the front-end.

Here's an example of how your `src/index.js` file might look:

```javascript
import { registerBlockType } from '@wordpress/blocks';
import { RichText, MediaUpload } from '@wordpress/block-editor';
import { Button } from '@wordpress/components';

registerBlockType('my-custom-block/custom-block', {
  title: 'Custom Block',
  description: 'A custom block with a heading, paragraph, and image.',
  icon: 'format-image',
  category: 'common',

  attributes: {
    heading: {
      type: 'string',
      source: 'html',
      selector: 'h2',
    },
    paragraph: {
      type: 'string',
      source: 'html',
      selector: 'p',
    },
    imageUrl: {
      type: 'string',
      source: 'attribute',
      selector: 'img',
      attribute: 'src',
    },
  },

  edit: ({ attributes, setAttributes }) => {
    const { heading, paragraph, imageUrl } = attributes;

    return (
      <>
        <RichText
          tagName="h2"
          value={heading}
          onChange={(newHeading) => setAttributes({ heading: newHeading })}
          placeholder="Enter heading..."
        />
        <RichText
          tagName="p"
          value={paragraph}
          onChange={(newParagraph) => setAttributes({ paragraph: newParagraph })}
          placeholder="Enter paragraph..."
        />
        <MediaUpload
          onSelect={(newImage) => setAttributes({ imageUrl: newImage.url })}
          render={({ open }) => (
            <Button onClick={open}>
              {imageUrl ? <img src={imageUrl} alt="" /> : 'Upload Image'}
            </Button>
          )}
        />
      </>
    );
  },

  save: ({ attributes }) => {
    const { heading, paragraph, imageUrl } = attributes;

    return (
      <>
        <h2>{heading}</h2>
        <p>{paragraph}</p>
        {imageUrl && <img src={imageUrl} alt="" />}
      </>
    );
  },
});
```

4. Build the block:
   - Run the following command to build the block:
     ```
     npm run build
     ```

5. Activate the block plugin:
   - Go to the WordPress admin dashboard.
   - Navigate to the "Plugins" page

